import React, { useEffect, useState } from "react";
import axios from "axios";

type Lab1AVariance = {
  matrices: number[][][];
};

type GeneratedLab1AVariance = {
  number: number;
  variance: Lab1AVariance;
};

type Lab1AVariant = {
  user_id: number;
  variant: GeneratedLab1AVariance;
};

const Lab1aVariance: React.FC = () => {
  const [data, setData] = useState<Lab1AVariant | null>(null);
  const [loading, setLoading] = useState<boolean>(false);
  const [error, setError] = useState<string | null>(null);

  const fetchData = async () => {
    setLoading(true);
    setError(null);

    try {
      const token =
        "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJleHAiOjE3MzQwNzI1ODIsImlhdCI6MTczNDAyOTM4MiwidXNlcl9pZCI6NCwidXNlcl9wb3N0Ijoic3R1ZGVudCJ9.HVKOr05Ejm9qEdWu1S-AJQBmrgUTu1pjADdHV8vFGjI";
      const labToken = "ajkdfnshdabvpdhifvndsfjhlnfsjdlfkjsdfsdfsdf";

      const response = await axios.get<Lab1AVariant>("http://localhost:8001/lab1a/variant", {
        headers: {
          Authorization: `Bearer ${token}`,
          "lab-token": labToken,
        },
        params: {
          laboratory_id: 1,
        },
      });

      setData(response.data);
    } catch (err: any) {
      setError(err.message || "Ошибка при выполнении запроса");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  if (loading) {
    return <div>Загрузка...</div>;
  }

  if (error) {
    return <div>Ошибка: {error}</div>;
  }

  return (
    <div style={{ padding: "20px" }}>
      <h1>Generated Lab1A Variance</h1>
      {data ? (
        <div>
          <h2>Variant Number: {data.variant.number}</h2>
          <div style={{ display: "flex", flexDirection: "column", gap: "20px" }}>
            {data.variant.variance.matrices.map((matrix, matrixIndex) => (
              <div key={matrixIndex}>
                <h3>Matrix {matrixIndex + 1}</h3>
                <table border="1" style={{ borderCollapse: "collapse" }}>
                  <tbody>
                    {matrix.map((row, rowIndex) => (
                      <tr key={rowIndex}>
                        {row.map((cell, cellIndex) => (
                          <td
                            key={cellIndex}
                            style={{
                              padding: "10px",
                              textAlign: "center",
                            }}
                          >
                            {cell}
                          </td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            ))}
          </div>
        </div>
      ) : (
        <div>Нет данных для отображения.</div>
      )}
    </div>
  );
};

export default Lab1aVariance;
